class Solution:
    def maxOperations(self, s: str) -> int:
        one_count = 0
        i = 0
        operation = 0
        move = False
        while(i < len(s)):
            if(s[i] == '0'):
                move = True
            else:
                if(move):
                    operation += one_count
                    move = False
                one_count += 1
            i += 1
        else:
            if(move):
                operation += one_count
        return operation
